import React, { Component } from 'react';
import './login.css'

class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {
      user: '',
      password: ''
    };
  }

  userinput = (e) => {
    this.setState({
      user: e.target.value
    })
  }

  passwordinput = e => {
    this.setState({
      password: e.target.value
    })
  }

  render() {
    return (
      <div className="container-fluid">
        <div className="row ">
          <div className="panel panel-default col-md-4 col-md-offset-4">
            <div className="paneleading">欢迎来到后台管理系统</div>
            <div className="panel-body">
              <form className="form-horizontal">
                <div className="form-group">
                  <div className="col-sm-10">
                    <input type="text" className="form-control" placeholder="请输入用户名" />
                  </div>
                </div>
                <div className="form-group">
                  <div className="col-sm-10">
                    <input type="password" className="form-control" placeholder="请输入密码" />
                  </div>
                </div>
                
                <div className="form-group">
                  <div className="col-md-offset-4 col-md-2">
                    <button className="btn btn-primary">登录</button>
                  </div>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>



    );
  }
}

export default Login;
